hljs.registerLanguage("maxima-console", function() {
  return {
    name: "Maxima Console",
    keywords: {
      keyword: "true"
    },
    contains: [
      {
        className: "meta",
        begin: /^\(%[io]\d+\) /
      },
      {
        className: "meta",
        begin: /^% /
      },
    ],
  };
});
